import React, { Component } from "react"
import Section from "../components/Section"
import { BrowserRouter as Router, Route, Switch } from "react-router-dom"
import Navbar from "../components/Navbar"

export default class AdminRoot extends Component {
    constructor(props) {
        super(props)
        this.path = this.props.match.path
        console.log('PATH:', this.path)
    }
    render() {
        return (
            <>
            <Navbar />
            <div className="body">
                <div className="large page-title">
                    Admin
                </div>
                <Section to={`${this.path}/businesses`} title='Manage businesses' />
                <Section to={`${this.path}/add_business`} title='Add businesses' />
            </div>
            </>
        )
    }
}
